import React from 'react';
import blurred_shatter from "./blurred_shatter.png";

const CardItem = () => {
    return (
        <div>
            <div class="cards">
                <div class="card eevee animated">
                    <img src={blurred_shatter} alt="logo" />
                </div>
            </div>
            <script class="hover"></script>
            {/* <script src="script.js"></script> */}
        </div>
    )
}

export default CardItem;
